import "../App.css";
import avtar4 from "../images/avtar4.jpg";
export const UserList = (props) => {
  const [inHover, setHover] = useState(false);
  return (
    <div>
      <div className="container">
        <table>
          <tr onMouseEnter={() => setHover(true)}
        onMouseLeave={() => setHover(false)}  >
            {inHover && <p className="hover">Hi!</p>}
            <td className="set">
              {props.imgavtar}
              <p className="setitem">
                {props.name}
                <br />
                {props.email}
              </p>
            </td>

            <td className="setstatus">{props.status}</td>
            <td className="setstatus">{props.Access}</td>
            <td className="setstatus">{props.action}</td>
          </tr>
        </table>
      </div>
      <div class="card">
  <img src={avtar4} alt="Avatar" className="imgset"/>
  <div class="container">
    <h4><b>John Doe</b></h4> 
    <p>Architect & Engineer</p> 
  </div>
</div>
    </div>
  );
};
export default UserList;
